import gql from 'graphql-tag';

export const metricsQuery = gql`
  query MetricsQuery(
    $sourceId: ID!
    $timerange: InfraTimerangeInput!
    $metrics: [InfraMetric!]!
    $nodeId: ID!
    $nodeType: InfraNodeType!
  ) {
    source(id: $sourceId) {
      id
      metrics(nodeId: $nodeId, timerange: $timerange, metrics: $metrics, nodeType: $nodeType) {
        id
        series {
          id
          data {
            timestamp
            value
          }
        }
      }
    }
  }
`;
